/* eslint-disable no-unused-vars */

//import PreviewCard from './components/SkuListDetails';

//import SkuListTools from "./components/SkuListTools";
import useAuth from "../../hooks/useAuth";
import React, { useState } from "react";
import { useTheme } from "@mui/material/styles";
import { Card, CardContent } from "@mui/material";
import SubCard from "ui-component/cards/SubCard";
import SkuListTable from "./componentes/SkuListTable";
import Carrierform from "./componentes/carrierform";
import Validarups from "./componentes/validarups";

export const SkuListApp = () => {
  const theme = useTheme();

  const cardStyle = {
    background:
      theme.palette.mode === "dark"
        ? theme.palette.dark.main
        : theme.palette.grey[50],
    border: "1px solid",
    borderColor: theme.palette.primary.main,
  };
  const { logout, user } = useAuth();

  const [fedex, setfedex] = useState({});
  const [ups, setups] = useState({});
  const [dhl_express, setdhl_express] = useState({});

  const [oculto, setoculto] = useState({
    //hiddenlistools: false,
    //hiddenstoreform: false,
    hiddentable: true,
    hiddenform: false,
    activaups: false,
    activafedex: false,
    activadhl: false,
    //hiddendetails: false,
  });

  return (
    <>
      <SubCard title="Operadores Conectados">
        <Card sx={cardStyle}>
          <CardContent
            sx={{ minHeight: 240, color: theme.palette.common.black }}
          >
            {oculto.hiddentable ? (
              <SkuListTable
                oculto={oculto}
                setoculto={setoculto}
                idcliente={user.id}
              />
            ) : null}
            {oculto.hiddenform ? (
              <Carrierform
                oculto={oculto}
                setoculto={setoculto}
                idcliente={user.id}
                fedex={fedex}
                setfedex={setfedex}
                ups={ups}
                setups={setups}
                dhl_express={dhl_express}
                setdhl_express={setdhl_express}
              ></Carrierform>
            ) : null}
            {oculto.activaups ? (
              <Validarups ups={ups} setups={setups} idcliente={user.id}></Validarups>
            ) : null}
          </CardContent>
        </Card>
      </SubCard>
    </>
  );
};

export default SkuListApp;
